import React from "react";
import { BrowserRouter as Router, Routes, Route, Navigate, useLocation } from "react-router-dom";
import ScrollToTop from "./components/ScrollToTop";
import NavBar from "./components/NavBar";
import AuthDebug from "./components/AuthDebug";
import Home from "./pages/Home";
import About from "./pages/About";
import Services from "./pages/Services";
import Contact from "./pages/Contact";
import Faq from "./pages/Faq";              // ✅ lowercase aq matches filename
import "./styles/App.css";
import { AuthProvider, useAuth } from "./context/AuthContext";
import PrivateHome from "./pages/PrivateHome";
import CreateProfile from "./pages/CreateProfile";
import RequestAccess from "./pages/RequestAccess";
import EditProfile from "./pages/EditProfile";
import Blog from "./pages/Blog";
import InvitesAdmin from "./pages/InvitesAdmin";
import UsersAdmin from "./pages/UsersAdmin";
import Login from "./pages/Login";

const ProtectedRoute = ({ children }) => {
  const { authorized } = useAuth();
  return authorized ? children : <Navigate to="/" replace />;
};
const AdminRoute = ({ children }) => {
  const { authorized, role } = useAuth();
  return authorized && role === 'admin' ? children : <Navigate to="/" replace />;
};
const AppContent = () => {
  const location = useLocation();
  return (
    <>
      <ScrollToTop />
      <NavBar />
      <AuthDebug />
      <Routes future={{ v7_relativeSplatPath: true }}>
          <Route
            path="/"
            element={
              useAuth().authorized ? <Navigate to="/welcome" replace /> : <Home />
            }
          />
          <Route
            path="/about"
            element={
              <ProtectedRoute>
                <About />
              </ProtectedRoute>
            }
          />
          <Route
            path="/services"
            element={
              <ProtectedRoute>
                <Services />
              </ProtectedRoute>
            }
          />
          <Route
            path="/contact"
            element={
              <ProtectedRoute>
                <Contact />
              </ProtectedRoute>
            }
          />
          <Route
            path="/faq"
            element={
              <ProtectedRoute>
                <Faq />
              </ProtectedRoute>
            }
          />
          <Route path="/requestaccess" element={<RequestAccess />} />
          <Route path="/login" element={<Login />} />
          <Route
            path="/welcome"
            element={
              <ProtectedRoute>
                <PrivateHome />
              </ProtectedRoute>
            }
          />
          <Route
            path="/create-profile"
            element={
              <ProtectedRoute>
                <CreateProfile />
              </ProtectedRoute>
            }
          />
          <Route
            path="/editprofile"
            element={
              <ProtectedRoute>
                <EditProfile />
              </ProtectedRoute>
            }
          />
          <Route
            path="/edit-profile"
            element={
              <ProtectedRoute>
                <EditProfile />
              </ProtectedRoute>
            }
          />
          <Route
            path="/blog"
            element={
              <ProtectedRoute>
                <Blog />
              </ProtectedRoute>
            }
          />
          <Route
            path="/admin/invites"
            element={
              <AdminRoute>
                <InvitesAdmin />
              </AdminRoute>
            }
          />
          <Route
            path="/admin"
            element={
              <AdminRoute>
                <Navigate to="/admin/users" replace />
              </AdminRoute>
            }
          />
          <Route
            path="/admin/users"
            element={
              <AdminRoute>
                <UsersAdmin />
              </AdminRoute>
            }
          />
        </Routes>
    </>
  );
};

const App = () => {
  return (
    <AuthProvider>
      <Router>
        <AppContent />
      </Router>
    </AuthProvider>
  );
};

export default App;

